<br />
対応機種<br /> 
AVIC-MRZ03II/MRZ03<br /><br />
※iPod/iPhone接続の場合には、「CD-IUV51M」が別途必要になります。 <br />
※ミニジャック(3.5Φ)映像/音声出力付外部機器を接続する場合は、「CD-V150M」が、ミニジャック(3.5Φ)音声出力付外部機器の接続の場合は「CD-150M」が別途必要。<br /> 
