br>パイオニア フリップダウンモニター取付キット。<br>TVM-FW1040-B/FW1030-B/FW-1030-S/FW1020-S対応<br><br>
■対象車種<br>　ホンダ ステップワゴン / ステップワゴンスパーダ（H27/4～現在）<br>
■形式<br>　RP1系、RP2系、RP3系、RP4系<br>
