※ヘッドライニングを下ろさずに取付作業を行った場合には、モニター本体の前後に各2か所のルーフキャップが付きます<br>
※サイドエアバッグシステム装着車の場合、純正部品「アッパクリップ（91561-TV1-E11）」1個が必要になります<br>
※アシストグリップを取外す際、作業上破損する可能性が高いため、純正部品「キャップＡ(83244-TY2-A01ZJ)」、「キャップB(83245-TY2-A01ZJ)」を事前にご用意いただくことをお奨めします。</font><style type="text/css">
