【特長】<br>
・すき間にさし込む方式 　（特許出願中)<br>
　輸入車のデッキのすき間に差し込んで固定するスタンドのため、取付、取外しが簡単です。<br><br>
・1mm厚のステンレス製ステー<br>
　ステーの形状と先端がさし込みやすい工夫がされており、わずかなすき間に固定できます。<br>
　美しくて丈夫なステンレス製で、ほとんどの部位は隠れてしまいますので、さりげなく取付けしたい方には安心してご使用になれます。<br><br>
・上下左右方向の調節機構付<br>
　ヘッド部にボールジョイント採用により上下左右の調整が可能になりました。
<br>
・豊富なホルダー（別売）でシステムアップ可能
 <br><br>

【仕様】<br>
・本体サイズ<br>
　55（高さ）×37（幅）×147（奥行）mm<br>
・すき間に差し込んで固定
<br>
<br>
【付属品】<br>
・ウレタン<br>
・両面テープ<br>
<br>
【注意事項】<br>
・本製品は、完全に固定するものではありません。スタンドを強く引けば引抜けますのでご注意ください。<br>
※重量物は取付けないでください。<br>
・車種によっては、スイッチやエアコン吹き出し口と干渉する場合があります。<br>
・取付け時のキズ傷防止のため、パネル等に養生テープなどを貼って作業してください。<style type="text/css">
