【特長】<br>
・強力アーム採用で固定率をアップ<br>
・Q-Ban Kitシリーズに装着することにより車載マウントシステムとしての利用が広がります。<br>
<br>
【可動部説明】<br>
■左右調整固定ノブ<br>
ベースマウント部の位置を固定します。<br>
・両面テープ止めやネジ止めが可能。<br>
■上下調整固定ノブ<br>
アーム部の上下の位置を固定します。<br>
■Q-Banロックレバー<br>
レバーを下ろすとしっかりとQ-Banを固定できます。<br>
<br>
【仕様】<br>
・固定ノブ式を採用<br>
・重量物も固定できる強力アーム<br> 
・本体サイズ：84～132（高さ）mm<br>
・ベース部直径：62mm<br>
※ホルダーQBA10、11はレバーが干渉するため取付できません。<br>
<br>
【付属品】<br>
・ジョイントパーツ<br>
・ジョイントパーツ取付けネジ×4<br>
<br>
【注意事項】<br>
・前面ガラス及び、運転席側・助手席側の側面ガラスへの設置は法律で禁止されています。<br>
・当製品は車両に別売りQ-ban Kitを自在に固定する為の製品です。<br>
・ポータブルナビ、モバイル機器、携帯電話等をホールドする機能はありません。別売りQ-ban Kitと組み合わせてご使用てください。<br>
・吸盤を吸着させる場合は、ゴミやホコリ等に注意して平面に吸着させて下さい。<br>
<font color="#ff0000">・吸盤の吸着は使用条件により外れる可能性があります。<br>
・耐荷重は、使用条件や環境により異なります。<br></font><style type="text/css">
